import React from "react"
import { Link } from "react-router-dom";
const HamburgerDropDown = ({handleham}) => {

    return <div className="ham">
        <div id="myDropdown" className="dropdown-content">
   <Link to="/"> <a className="" href="#home">Home</a></Link>
   <Link to="xstream"> <a className="" href="#about">X Stream</a></Link>
   <Link to="news"> <a className="" href="#contact">News</a></Link>
  </div>

    </div>
}

export default HamburgerDropDown;
